btnShowChart.addEventListener('click',function () {


    //     тут будет fech для генерации данных для графика


        // create data table on loaded data
        var dataTable = anychart.data.table();
        dataTable.addData(DataForChart);

        // map loaded data
        var UsersAllInLevel = dataTable.mapAs({'value': 1});
        var usersInHour = dataTable.mapAs({'value': 2});
        var maxLinesUsers = dataTable.mapAs({'value': 4});
        var minLinesUsers = dataTable.mapAs({'value': 3});

        // create stock chart
        var chart = anychart.stock();

        // create the plot on the chart with column series
        var plot_column = chart.plot(1);
        var plot_line_ohlc = chart.plot(0);

        // Create and tune additional y scale
        // var extraYScale = anychart.scales.linear(0);
        // extraYScale.minimum(0);
        // extraYScale.maximum(18000);
        // var extraTicks = extraYScale.ticks();
        // extraTicks.interval(100);

        // Create and tune additional y axis
        // var extraYAxis = plot_line_ohlc.yAxis(1);
        // extraYAxis.orientation("right");
        // extraYAxis.scale(extraYScale);

        var columnSeries2 = plot_line_ohlc.column(maxLinesUsers);
        columnSeries2.color('#326798');
        columnSeries2.stroke('2 #326798');
        columnSeries2.labels().useHtml(true).format(function () {
            return '<b>Wallet: </b>' + this.x;
        })
        columnSeries2.name("[Max] текущей линии");

        var columnSeries3 = plot_line_ohlc.column(minLinesUsers);
        columnSeries3.stroke('3 #3b4253');
        columnSeries3.color('#3b4253');
        columnSeries3.name("[Min] текущей линии");

        // create line series
        var lineSeries = plot_line_ohlc.line(UsersAllInLevel);
        lineSeries.color("#ffffff");
        lineSeries.stroke("2 #ffffff");
        lineSeries.labels().useHtml(true).format(function () {
            return '<b>Wallet: </b>' + this.x;
        })
        lineSeries.name("[Now] игроков на уровне");

        // create the column series
        var columnSeries1 = plot_column.column(usersInHour);
        columnSeries1.color('white');
        columnSeries1.stroke('white');
        columnSeries1.labels().useHtml(true).format(function () {
            return '<b>NameName: </b>' + this.x;
        })
        columnSeries1.name("[Add] игроков в час");

        chart.background().fill("#2e323f");

        document.body.querySelector('#myChart').style.height = "600px"

        // set container id for the chart
        chart.container('myChart');


        // initiate chart drawing

        chart.draw();



});

